import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <nav className="navbar navbar-expand-lg bg-body-tertiary px-3">
            <div className="container-fluid">
                <Link to="/" className="navbar-brand fw-bold">MegaMart</Link>

                {/* Search + Cart */}
                <div className="d-flex align-items-center gap-3">

                    {/* Search Form */}
                    <form
                        className="d-flex"
                        role="search"
                        onSubmit={(e) => e.preventDefault()}
                    >
                        <input
                            className="form-control me-2"
                            type="search"
                            placeholder="Search products"
                            aria-label="Search"
                        />
                        <button className="btn btn-outline-success" type="submit">
                            Search
                        </button>
                    </form>


                    <Link to="/cart" className="d-flex align-items-center text-decoration-none text-dark">
                        <i className="bi bi-cart fs-3 me-1"></i> <span className="fw-semibold">Cart (0)</span>
                    </Link>

                </div>
            </div>
        </nav>
    );
}
